Defendant Tanya S Holliman in court with Attorney Richard Jeffrey Carpenter.  Irene E. Parthum for Margaret Anne Kunisch appeared for the State of Wisconsin.

Matter here for sentencing.  Sentencing proceeded.  Statements by the State, defense and defendant.  Additional statements by:  Sandra T.  The Court imposed the following sentence:  The Defendant's TOTAL LENGTH OF SENTENCE shall be  THIRTY-SIX (36) months consecutive to any other sentence.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for EIGHTEEN (18) months with credit for THREE (3) days time served.  Defendant shall serve EIGHTEEN (18) months on EXTENDED SUPERVISION.  The Court STAYS sentence and orders PROBATION for TWO (2) years.

The defendant is not eligible for the Challenge Incarceration Program;
The defendant is not eligible for the Wisconsin Substance Abuse Program.  

The Court advised the defendant of the determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant. 

Court advised defendant that as a convicted felon he may never possess any gun or other firearms. 
Court advised defendant that his voting rights are suspended, and may not vote in any election until his civil rights are restored.  

CONDITIONS OF EXTENDED SUPERVISION:
 - No controlled substances or alcohol;
 - AODA assessment; treatment, if needed;
 - Random urine screens to ensure compliance;
 - No contact with victim, Rita S., or her residence;
 - Perform 75 hours of community service;
 - Defendant is NOT to be employed in any position that has a condition of trust;
 - Defendant has to inform all future employers of conviction;
 - The Defendant has to serve FOURTY-FIVE (45) days in the House of Corrections--STRAIGHT TIME--NO GOOD TIME--NO ELECTRONIC MONITORING.  Defendant is to report to the House of Correction on April 14, 2016 by 5:00pm;
 - Restitution is set at ZERO;
 - Pay the DNA surcharge, costs and disbursements by the end of probationary period.  Failure to pay amounts in full would result in a civil judgment entered against defendant.

Filed,
Ineligible Voting Notice & Acknowledgement;
